import React from 'react';
import { Image, Text, TouchableOpacity, View } from 'react-native';

import styles from "./style";
const source = require('../../../assets/images/R1016-final-photo-1.jpg');
const shiper = require('../../../assets/images/delivery.png');

const CartItem : React.FC = () => {
    return (
        <View style = {styles.containerCart}>
            <View style = {styles.item1}>
                <Image source={source} resizeMode='contain' style = {styles.img}/>
            </View>
            
            <View style = {styles.item2}>
                <Text>Bánh hạnh nhân dừa</Text>
                <Text>Nguyên liệu: dừa, đường, trứng, sữa, socola</Text>
                <TouchableOpacity>
                    <Text>Hủy</Text>
                </TouchableOpacity>
            </View>
            
            <View style = {styles.item3}>
                <Text>120.000 đ</Text>
                <TouchableOpacity>
                    <Image source={shiper} style = {styles.imgShiper}/>
                </TouchableOpacity>
            </View>
        </View>
    );
};

export default CartItem;
